import React from "react";
import reactDom from "react-dom";
import { StyleSheet, Text, Button, View, Image } from 'react-native';

const styles = StyleSheet.create({
    mainContainer: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        justifyContent: 'center'
    },
    mainView: {
        backgroundColor: "#3838e0",
        marginBottom: 20,
        height: 330,
    },
    buttonView: {
        borderColor: 'black',
        position: 'absolute',
        backgroundColor: 'white',
        borderRadius: 20,
        padding: 15,
        borderWidth: 1,
    },
    title: {
        textAlign: 'center',
        marginTop: 20,
        marginBottom: 10,
        fontFamily: 'Arial',
        fontSize: 40,
        fontWeight: 'bold',
        color: '#3838e0'
    },
    subtitle: {
        textAlign: 'center',
        marginTop: 10,
        marginBottom: 35,
        fontFamily: 'Arial',
        fontSize: 20,
        fontWeight: 'light',



    }
});


const StartUp = () => {    
    return (
        <View>
            <View style={styles.mainView }>
                <Image source={require('../../assets/icons/main_icon.png')} style={{width: 50, height: 50}} />
            </View>

        <View style={styles.mainContainer}>
            <View style={styles.buttonView}>
                <Text style={styles.title}>GymBooking</Text>
                <Text style={styles.subtitle}>Supérate día a día</Text>
                <Button title="Iniciar Sesión"/>
                <Button title="Registrarse"/>
            </View>
        </View>
        </View>
    );
};

export default StartUp;
